import React from 'react';
import CartItem from '../CartItem/CartItem';

const CartList = (props) => {

    const { cartArr, setCart } = props

    return (
        <saction>
            <ul className='cart-list'>
                {cartArr.map(({ src, header, count, article }) => <CartItem key={article} setCart={setCart} src={src} header={header} count={count} />)}
            </ul>
        </saction>
    );
}

export default CartList;
